import React, { Component } from 'react';
import './list.css' ;
import PropTypes from 'prop-types';


class List extends Component{
    constructor(props){
        super(props);
        this.listItems = prop.listItems;
        this.listID = props.listID
    }

    render(props){
        return(
            <div>
                <h1>{this.message}</h1>
            </div>
        )
    }
}


export default List;
